import React from 'react'
import { directive } from '@babel/types';

const Contacts = ({ contacts }) => {
    return (
        <div>
            <center><h1>Graph Representation</h1></center>
            {contacts.map((contact) => (
                <div>
                    <p>{contact.to}</p>
                    <p>{contact.from}</p>
                </div>                
            ))}
        </div>
    )
};

export default Contacts
